import Grid from 'react-css-grid'

const Game = ({ name }) => {
  return (
    <Grid 
        width={320}
        gap={24}>
            
        <div>Column</div>
        <div>Column</div>
        <div>Column</div>
        <div>Column</div>

    </Grid>
  )
}

export default Game
